import { Fragment } from "react";
import { Outlet, Link } from "react-router-dom";

const Navigation = () => {
  return (
    <Fragment>
      <div className="navigation">
        <Link className="logo-container" to="/home">
          <div>logo</div>
        </Link>

        <div className="links-container"></div>
      </div>

      <Outlet />
    </Fragment>
  );
};

export default Navigation;
